              description: >-
                When it comes to food, fish crows are not picky and will
                eat just about anything. If there is anything left over,
                they will cache the surplus for later and use it to feed
                their young. Pairs are affectionate and often preen the
                back of each other's heads, but they can be quite the
                troublemakers when dealing with other birds. They have
                been known to harass them and steal food, as well as raid
                nests.
              name: Fish Crow
              iconUrl: >-
                https://assets.cms-api-graphql.cms-api.prod.aws.mybirdbuddy.com/asset/icon/bird/b0a7b955-60fb-44f2-914d-ac5fa633d3dc_Fish%20Crow.svg
