              description: >-
                When the cows come home, so do brown-headed cowbirds; they
                get their name from following around grazing livestock
                that bring a lot of insects for them to eat. Work smart,
                not hard, right? That seems to apply to their parenting
                style as well or lack thereof. They are notorious nest
                parasites, laying eggs in the nests of other birds. When
                the baby cowbird hatches, it will roll the other eggs out
                of the nest!
              name: Brown-Headed Cowbird
              iconUrl: >-
                https://assets.cms-api-graphql.cms-api.prod.aws.mybirdbuddy.com/asset/icon/bird/05b22f92-60b2-442f-aef4-bb8506c50a20_brown%20headed%20cowbird.svg
