            species:
              id: 31909c50-93f9-447d-a1b8-65c939c9ff71
              description: >-
                There's no family like a crow family! A crow family is
                composed of around 15 crows and up to five different
                generations of young. Young crows help out with family
                duties before they start breeding between the ages of two
                and four. They are also very smart! They know how to make
                and use tools and know to follow other animals to find and
                steal their food.
              name: American Crow
              iconUrl: >-
                https://assets.cms-api-graphql.cms-api.prod.aws.mybirdbuddy.com/asset/icon/bird/54b8db66-fda1-4567-9f92-5ac50b154571_d138f3b3-8b1f-41c5-a8e2-0d7baec9d42c_American%20Crow.svg
