            species:
              id: fbc390ca-dd72-48dd-8c6b-86277119ef23
              description: >-
                These noisy birds will come to your feeders but usually
                eat from the ground and sometimes maybe even steal food
                right from under other birds' beaks! They engage in a
                practice called anting – this means they allow ants to
                walk all over their body and secrete formic acid, which is
                thought to kill parasites. Ants aren't their only means of
                pest control, though, they also use walnut juice,
                mothballs, lemons, limes and chokecherries.
              name: Common Grackle
              iconUrl: >-
                https://assets.cms-api-graphql.cms-api.prod.aws.mybirdbuddy.com/asset/icon/bird/d0fd93f1-c94b-4adf-9ed4-5eea09dece54_common%20grackle.svg
