              description: >-
                House sparrows have long been our companions, living
                alongside us since the Stone Age and are still found in
                places where humans live. They are social birds that roost
                in groups and engage in social singing, meaning multiple
                birds will call together from bushes, like a little
                sparrow choir. Cleanliness is important and you will
                frequently see them taking dust baths!
              name: House Sparrow
